import React from "react";

import { makeStyles } from "@material-ui/core";
import Image from "next/image"

const useStyles = makeStyles({
    root: {
        display: 'flex',
        alignItems: 'center'
    }
})

const Topbar: React.FC<{}> = () => {
  return (
      <div>
          <Image src="/assets/logo.png" />
      </div>
  );
};

export default Topbar;
